import React from 'react'
import {StyledWrapper,
    CollectionItemImage} from './styles'

const CollectionItem = ({id,name,price,image}) => {
  return (
    <StyledWrapper>
      <CollectionItemImage>
        <div key={id}>{name}</div> 
      </CollectionItemImage>
    </StyledWrapper>
  )
}

export default CollectionItem
